package main

import (
	"github.com/adrien3d/adventofcode/utils"
	"strings"
)

func solve(input string, verbose bool) (part1TotalScore, part2TotalScore int) {
	for _, groupAnswer := range strings.Split(input, "\n\n") {
		uniqueResp := make(map[string]int)
		answers := strings.Split(groupAnswer, "\n")
		for _, answer := range answers {
			for _, char := range answer {
				uniqueResp[string(char)]++
				if uniqueResp[string(char)] == len(answers) {
					part2TotalScore++
				}
			}
		}
		part1TotalScore += len(uniqueResp)
	}
	return part1TotalScore, part2TotalScore
}

